import "./Feature.css"
function Feature(myProps) {
    console.log(myProps);
    return (
        <div className="feature" style={{backgroundColor: myProps.bgColor}}>
            <h2>{myProps.title}</h2>
            <p>{myProps.content}</p>
            <button className="buttons">Example button</button>
        </div>
    )
}
export default Feature;
